// contracts/UserAndModelRegistry.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract UserAndModelRegistry {
    address public admin;

    // ------------------ USER SECTION ------------------
    struct User {
        address wallet;
        string username;
    }

    mapping(address => User) public users;
    mapping(address => bool) public userExists;

    event UserAdded(address indexed wallet, string username);

    // ------------------ MODEL SECTION ------------------
    struct ModelUpdate {
        uint256 roundNumber;
        uint256 accuracy; // e.g., 9889 = 98.89%
        bytes32 modelHash; // SHA-256 or similar hash
        string offChainReference; // IPFS CID or external link
        address submitter;
        uint256 timestamp;
    }

    ModelUpdate[] public updates;

    event ModelUpdated(
        uint256 indexed roundNumber,
        uint256 accuracy,
        bytes32 modelHash,
        string offChainReference,
        address indexed submitter,
        uint256 timestamp
    );

    // ------------------ CONSTRUCTOR ------------------
    constructor() {
        admin = msg.sender; // Deployer is admin
    }

    // ------------------ MODIFIER ------------------
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    // ------------------ USER FUNCTIONS ------------------
    function addUser(address _wallet, string memory _username) external onlyAdmin {
        require(!userExists[_wallet], "User already exists");
        users[_wallet] = User(_wallet, _username);
        userExists[_wallet] = true;
        emit UserAdded(_wallet, _username);
    }

    function getUser(address _wallet) external view returns (address, string memory) {
        require(userExists[_wallet], "User does not exist");
        User memory u = users[_wallet];
        return (u.wallet, u.username);
    }

    // ------------------ MODEL FUNCTIONS ------------------
    function addModelUpdate(
        uint256 _roundNumber,
        uint256 _accuracy,
        bytes32 _modelHash,
        string calldata _offChainReference
    ) external onlyAdmin {
        ModelUpdate memory update = ModelUpdate({
            roundNumber: _roundNumber,
            accuracy: _accuracy,
            modelHash: _modelHash,
            offChainReference: _offChainReference,
            submitter: msg.sender,
            timestamp: block.timestamp
        });

        updates.push(update);

        emit ModelUpdated(
            _roundNumber,
            _accuracy,
            _modelHash,
            _offChainReference,
            msg.sender,
            block.timestamp
        );
    }

    function getUpdateCount() external view returns (uint256) {
        return updates.length;
    }

    function getUpdate(uint256 index)
        external
        view
        returns (
            uint256 roundNumber,
            uint256 accuracy,
            bytes32 modelHash,
            string memory offChainReference,
            address submitter,
            uint256 timestamp
        )
    {
        require(index < updates.length, "Invalid index");
        ModelUpdate memory u = updates[index];
        return (
            u.roundNumber,
            u.accuracy,
            u.modelHash,
            u.offChainReference,
            u.submitter,
            u.timestamp
        );
    }

    function getLatestUpdate()
        external
        view
        returns (
            uint256 roundNumber,
            uint256 accuracy,
            bytes32 modelHash,
            string memory offChainReference,
            address submitter,
            uint256 timestamp
        )
    {
        require(updates.length > 0, "No updates available");
        ModelUpdate memory u = updates[updates.length - 1];
        return (
            u.roundNumber,
            u.accuracy,
            u.modelHash,
            u.offChainReference,
            u.submitter,
            u.timestamp
        );
    }
}

